import React from 'react';
/**
* @author
* @function Header
**/

const Header = (props) => {
  return(
    <div className='headertext'>
      <div className="container-fluid headerText">
        <div className="container">
          <div className="row">
          <div className="col">Documentation</div>
          </div>
        </div>
      </div>
    </div>
   )
 }

export default Header;
